import React from 'react';
import search from '../../../images/search.png';
import timersand from '../../../images/timer-sand.png';
import nature from '../../../images/nature.png';
import medal from '../../../images/medal.png';
import currencyusdoff from '../../../images/currency-usd-off.png';


export default function Who() {
    return (
        <div>
            <div>
            5àsec propose un concept innovant et évolutif, soutenu par une politique R&D ambitieuse, un positionnement différenciant et un large panel de services et de produits pour les particuliers et les professionnels.
            <br/>
            L’excellence 5àsec, c’est une expérience client unique à la fois dans notre réseau physique et via notre offre digitalisée pour profiter du meilleur du pressing.
            </div>
            <div className='row'>
                <div className='col-md-6'>
                    <img src={search} width='50%' />
                </div>
                <div className='col-md-6'>
                    <img src={timersand} width='50%' />
                </div>
                <div className='col-md-6'>
                    <img src={medal} width='50%' />
                </div>
            </div>
        </div>
    )
}
